import { Chip, Collapse, createStyles, List, ListItem, ListItemText, ListSubheader, makeStyles, Theme } from '@material-ui/core'
import React from 'react'
import ExpandLess from '@material-ui/icons/ExpandLess'
import ExpandMore from '@material-ui/icons/ExpandMore'
import SkillsListItem from './SkillsListItem'

const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            width: '100%',
            backgroundColor: '#340152',
            justifyContent: 'center',
            justifyItems: 'center',
            justifySelf: 'center',
        },
        listItems: {
            width: '100%',
            maxWidth: 480,
        },
        nested: {
            color: 'white',
            paddingLeft: theme.spacing(4)
        },

    }),
)


function SkillsList() {
    const classes = useStyles()

    return (
        <List
            component="nav"
            aria-labelledby="nested-list-subheader"
            subheader={
                <ListSubheader component="div" id="nested-list-subheader" color='inherit'>
                    Skills
                </ListSubheader>
            }
            className={classes.root}
        >
            <div className={classes.listItems}>
                {SkillsListItem("Programming languages",
                    [
                        "Kotlin",
                        "Java",
                        "C++",
                        "C#",
                        "TypeScript",
                    ]
                )}

                {SkillsListItem("Markup languages",
                    [
                        "Xml",
                        "Html",
                        "CSS",
                        "Gradle",
                        "MD",
                    ]
                )}

                {SkillsListItem("Architectural pattern",
                    [
                        "MVVM"
                    ]
                )}

                {SkillsListItem("Frameworks / API / tools",
                    [
                        "Qt QML, Widgets",
                        "Android SDK",
                        "Rest API",
                        ".Net Core",
                        "Git",
                        "Windows API",
                        "Network sockets",
                        "Linux",
                    ]
                )}

                {SkillsListItem("Android related",
                    [
                        "Room",
                        "Realm",
                        "LiveData",
                        "Jetpack navigation",
                        "Lifecycles",
                        "Hilt",
                        "Material design",
                    ]
                )}
            </div>

        </List>
    )
}

export default SkillsList
